import React from "react";

function Footer() {
  return (
    <footer className="footer">
      <span className="footerSpan"><span className="blueSpan">G</span><span className="redSpan">o</span><span className="yellowSpan">o</span><span className="blueSpan">g</span><span className="greenSpan">l</span><span className="redSpan">e</span> Books Search</span>
    </footer>
  );
}

export default Footer;
